// React
import React, { Fragment } from "react";

import { Row, Col, Card } from "antd";

const OrderedList = ({ data }) => {
  return (
    <Fragment>
      <Row>
        {data.map(data => (
          <Col>
            <Card title={data.ordered_items}></Card>
          </Col>
        ))}
      </Row>
    </Fragment>
  );
};

export default OrderedList;
